  \"Non-Flammable Crew Clothing Utilizing Phosphorus-Based Fire Retardant Polymers
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 11,\n\t\t\"recent\": 3\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T21:15:45.879776\",\n\t\"name\":
  \"non-flammable-crew-clothing-utilizing-phosphorus-based-fire-retardant-polymers-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"For maintaining U.S. leadership role in
  space exploration, there is an urgent need to develop non-flammable shirts, shorts,
  sweaters, and jackets without compromising the comfort and flexibility of the fabrics.
  InnoSense LLC (ISL) proposes to utilize its phosphorus-containing ionic polymers
  in crew clothing. In Phase I, this project would demonstrate flame retardancy and
  perform standard tests showing adequate comfort, appearance, durability, and non-toxicity,
  which can be realized from ISL polymers. The overall goal is to take existing fabrics,
  with their desirable physical properties and high level of comfort, and inserting
  flame retardancy. The innovations of the proposed approach will offer durability
  of the treated fabric since the polymers will be covalently bonded to the fabrics.
  Phase I evaluation will also include biocompatibility of the treated fabrics. Fine-tuning
  and process scale up will be accomplished in Phase II.  \",\n\t\"license_title\":
